import ReactDOM from 'react-dom';
var createNode = function (children) {
    var mountPoint = document.createElement('div');
    mountPoint.className = 'g2-tooltip';
    ReactDOM.render(children, mountPoint);
    return mountPoint;
};
export default createNode;
